hat this was possibly something that was part of me and that I would have to accept would happen from time to time.  I used the metaphor of it feeling like being in a long dark tunnel which I couldn’t see the light at the end of… because of various life experiences we identified that stress was a trigger and that it was an old patterned conditioned response that on a subconscious level I had accepted was something that would remain a part of me. ..\r\n\r\nWe started with a 1 hour Skype session where Nick asked some very thought provoking questions…this alone was very powerful for me as it was something I had never brought out into the open before … this then resulted in what I can only describe as a journey of self discovery and as I opened up to the possibility of change I found myself facing new and unexpected challenges.\r\n\r\nI felt Nick was there every step of the way to coach,  guide and sometimes just listen through email’s,  texts and Skype, and when our monthly session approached I found this gave me an incredible boost of motivation knowing he was there to cheer on and encourage my progress.   The last session with Nick as we acknowledged how far I’d come felt amazingly liberating and emotional.   Nick’s coaching skills and natural empathy makes him one of the most powerful coaches I have ever met and if you are looking for the ultimate coaching experience I highly recommend you choose Nick'),(274,70,'_testimonial_text','field_5ead3a2dca171'),(275,70,'_edit_lock','1588413881:1'),(296,1,'_edit_lock','1588413027:1'),(321,58,'_wp_trash_meta_status','publish'),(322,58,'_wp_trash_meta_time','1588413975'),(323,58,'_wp_desired_post_slug','group_5ead39c9ca214'),(324,59,'_wp_trash_meta_status','publish'),(325,59,'_wp_trash_meta_time','1588413975'),(326,59,'_wp_desired_post_slug','field_5ead39d5ca170'),(327,60,'_wp_trash_meta_status','publish'),(328,60,'_wp_trash_meta_time','1588413975'),(329,60,'_wp_desired_post_slug','field_5ead3a2dca171'),(342,70,'_wp_trash_meta_status','publish'),(343,70,'_wp_trash_meta_time','1588414024'),(344,70,'_wp_desired_post_slug','theresa-j'),(353,91,'_edit_last','1'),(354,91,'_edit_lock','1588666797:1'),(359,93,'_edit_last','1'),(360,93,'_edit_lock','1588501209:1'),(369,91,'testimonial_by','Theresa J'),(370,91,'_testimonial_by','field_5ead51836cb01'),(371,91,'testimonial_content','\"I’ve just completed a 6-month Coaching Program with Nick and I have to say I am amazed and delighted with the results!\r\nI have been aware for years that although I have addressed many situations and challenges in my life sometimes I would find myself enveloped in what I described to Nick as a deep sadness.  I believed that this was possibly something that was part of me and that I would have to accept would happen from time to time.  I used the metaphor of it feeling like being in a long dark tunnel which I couldn’t see the light at the end of… because of various life experiences we identified that stress was a trigger and that it was an old patterned conditioned response that on a subconscious level I had accepted was something that would remain a part of me. ..\r\n\r\nWe started with a 1 hour Skype session where Nick asked some very thought provoking questions…this alone was very powerful for me as it was something I had never brought out into the open before … this then resulted in what I can only describe as a journey of self discovery and as I opened up to the possibility of change I found myself facing new and unexpected challenges.\r\n\r\nI felt Nick was there every step of the way to coach,  guide and sometimes just listen through email’s,  texts and Skype, and when our monthly session approached I found this gave me an incredible boost of motivation knowing he was there to cheer on and encourage my progress.   The last session with Nick as we acknowledged how far I’d come felt amazingly liberating and emotional.   Nick’s coaching skills and natural empathy makes him one of the most powerful coaches I have ever met and if you are looking for the ultimate coaching experience I highly recommend you choose Nick\"'),(372,91,'_testimonial_content','field_5ead51c66cb02'),(381,100,'_edit_last','1'),(382,100,'_edit_lock','1588419973:1'),(383,100,'testimonial_by','AR'),(384,100,'_testimonial_by','field_5ead51836cb01'),(385,100,'testimonial_content','“I have a well-developed and vociferous Inner Critic which gave rise over the years to an almost ever-present “Not Good Enough” and “Must Do Better” vibe. My life consisted largely of an exhausting upstream struggle driven by this: one in which I constantly sought validation  and approval from others. Any criticism, negative feedback or perceived failure would result in feelings of worthlessness and recurrent episodes of depression. \r\n\r\nVarious self-help books and counselling/therapy sessions facilitated me in identifying and understanding this, but, sadly, did not make many significant in-roads into muting the Critic and giving me a more easeful life. \r\n\r\nJust one session with Nick tapped into something deep in my sub-conscious and suddenly the Critic was muffled. What remained of her voice was now clothed in kinder and more compassionate tones. \r\n\r\nI HIGHLY recommend Nick’s approach and expertise to anyone dealing with issues similar to those described above. He was able to pave the way for me to access my own sub-conscious: to lock down some unhelpful parts of it and to release something softer, kinder and full of hope and light. \r\n\r\nI can imagine this approach being relevant and constructive in any less-than-satisfying areas in life. The sub-conscious is potent, yet elusive. Within it lies the power to change our lives, but often we need the help of someone like Nick to tap into this. Nick is approachable, intuitive, calm and wise and…WHAT HE DOES REALLY WORKS!!“'),(386,100,'_testimonial_content','field_5ead51c66cb02'),(443,115,'_menu_item_type','custom'),(444,115,'_menu_item_menu_item_parent','0'),(445,115,'_menu_item_object_id','115'),(446,115,'_menu_item_object','custom'),(447,115,'_menu_item_target',''),(448,115,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(449,115,'_menu_item_xfn',''),(450,115,'_menu_item_url','http://nicholasbarkercoaching.local/testimonials'),(460,118,'_menu_item_type','custom'),(461,118,'_menu_item_menu_item_parent','0'),(462,118,'_menu_item_object_id','118'),(463,118,'_menu_item_object','custom'),(464,118,'_menu_item_target',''),(465,118,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(466,118,'_menu_item_xfn',''),(467,118,'_menu_item_url','http://nicholasbarkercoaching.local/courses'),(468,119,'_edit_last','1'),(469,119,'_edit_lock','1588501891:1'),(470,122,'_edit_last','1'),(471,122,'_edit_lock','1588502324:1'),(472,122,'course_title','Course 1'),(473,122,'_course_title','field_5eae7593d0b93'),(474,122,'course_subheading','All about the course in less than two lines...'),(475,122,'_course_subheading','field_5eae75b3d0b94'),(476,123,'course_title','Course 1'),(477,123,'_course_title','field_5eae7593d0b93'),(478,123,'course_subheading','All about the course in less than two lines...'),(479,123,'_course_subheading','field_5eae75b3d0b94'),(480,122,'_thumbnail_id','44'),(481,122,'course_image','44'),(482,122,'_course_image','field_5eae9b738d5ea'),(483,122,'course_description','Lorem ipsum dolor sit amet, donec at ut ut blandit, odio massa morbi vel cillum urna, nam amcorper diam, dolor vivamus. Sed cursus viverra, fames neque nisl suscipit, et dictum pellentesque, mauris a volutpat rhoncus in id. Pede velit sit quis sed, dui elit, diam faucibus eros. Suspendisse donec et in, ugiat aeget dolor mi.'),(484,122,'_course_description','field_5eae9ba08d5eb'),(485,122,'course_price','25'),(486,122,'_course_price','field_5eae9c1c8d5ec'),(487,122,'additional_course_information','Lorem ipsum dolor sit amet, donec at ut ut blandit, odio massa morbi vel cillum urna, nam amcorper diam, dolor vivamus.'),(488,122,'_additional_course_information','field_5eae9c8a8d5ed'),(48