s:4:\"type\";s:8:\"textarea\";s:12:\"instructions\";s:23:\"Input given testimonial\";s:8:\"required\";i:1;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:1755:\"I’ve just completed a 6-month Coaching Program with Nick and I have to say I am amazed and delighted with the results!\r\n\r\nI have been aware for years that although I have addressed many situations and challenges in my life sometimes I would find myself enveloped in what I described to Nick as a deep sadness.  I believed that this was possibly something that was part of me and that I would have to accept would happen from time to time.  I used the metaphor of it feeling like being in a long dark tunnel which I couldn’t see the light at the end of… because of various life experiences we identified that stress was a trigger and that it was an old patterned conditioned response that on a subconscious level I had accepted was something that would remain a part of me. ..\r\n\r\nWe started with a 1 hour Skype session where Nick asked some very thought provoking questions…this alone was very powerful for me as it was something I had never brought out into the open before … this then resulted in what I can only describe as a journey of self discovery and as I opened up to the possibility of change I found myself facing new and unexpected challenges.\r\n\r\nI felt Nick was there every step of the way to coach,  guide and sometimes just listen through email’s,  texts and Skype, and when our monthly session approached I found this gave me an incredible boost of motivation knowing he was there to cheer on and encourage my progress.   The last session with Nick as we acknowledged how far I’d come felt amazingly liberating and emotional.   Nick’s coaching skills and natural empathy makes him one of the most powerful coaches I have ever met and if you are looking for the ultimate coaching experience I highly recommend you choose Nick\";s:11:\"placeholder\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";s:4:\"rows\";s:0:\"\";s:9:\"new_lines\";s:0:\"\";}','Testimonial Text','testimonial_text','trash','closed','closed','','field_5ead3a2dca171__trashed','','','2020-05-02 10:06:15','2020-05-02 10:06:15','',58,'http://nicholasbarkercoaching.local/?post_type=acf-field&#038;p=60',1,'acf-field','',0),(63,1,'2020-05-02 09:19:22','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2020-05-02 09:19:22','0000-00-00 00:00:00','',0,'http://nicholasbarkercoaching.local/?post_type=testimonials&p=63',0,'testimonials','',0),(65,1,'2020-05-02 09:21:05','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2020-05-02 09:21:05','0000-00-00 00:00:00','',0,'http://nicholasbarkercoaching.local/?post_type=testimonials&p=65',0,'testimonials','',0),(66,1,'2020-05-02 09:23:51','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2020-05-02 09:23:51','0000-00-00 00:00:00','',0,'http://nicholasbarkercoaching.local/?post_type=testimonials&p=66',0,'testimonials','',0),(68,1,'2020-05-02 09:24:37','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2020-05-02 09:24:37','0000-00-00 00:00:00','',0,'http://nicholasbarkercoaching.local/?post_type=testimonials&p=68',0,'testimonials','',0),(70,1,'2020-05-02 09:36:10','2020-05-02 09:36:10','','Theresa J','','trash','closed','closed','','theresa-j__trashed','','','2020-05-02 10:07:04','2020-05-02 10:07:04','',0,'http://nicholasbarkercoaching.local/?post_type=testimonials&#038;p=70',0,'testimonials','',0),(82,1,'2020-05-02 10:06:03','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2020-05-02 10:06:03','0000-00-00 00:00:00','',0,'http://nicholasbarkercoaching.local/?post_type=acf-field-group&p=82',0,'acf-field-group','',0),(86,1,'2020-05-02 10:07:04','2020-05-02 10:07:04','','Theresa J','','inherit','closed','closed','','70-revis