e, and when our monthly session approached I found this gave me an incredible boost of motivation knowing he was there to cheer on and encourage my progress.   The last session with Nick as we acknowledged how far I’d come felt amazingly liberating and emotional.   Nick’s coaching skills and natural empathy makes him one of the most powerful coaches I have ever met and if you are looking for the ultimate coaching experience I highly recommend you choose Nick\";s:11:\"placeholder\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";s:4:\"rows\";s:0:\"\";s:9:\"new_lines\";s:7:\"wpautop\";}','Testimonial Content','testimonial_content','publish','closed','closed','','field_5ead51c66cb02','','','2020-05-02 11:13:24','2020-05-02 11:13:24','',93,'http://nicholasbarkercoaching.local/?post_type=acf-field&#038;p=95',1,'acf-field','',0),(100,1,'2020-05-02 11:48:31','2020-05-02 11:48:31','','AR','','publish','closed','closed','','ar','','','2020-05-02 11:48:31','2020-05-02 11:48:31','',0,'http://nicholasbarkercoaching.local/?post_type=testimonials&#038;p=100',0,'testimonials','',0),(115,1,'2020-05-02 14:41:07','2020-05-02 14:41:07','','Testimonials','','publish','closed','closed','','menu-item','','','2020-05-03 10:37:46','2020-05-03 10:37:46','',0,'http://nicholasbarkercoaching.local/?p=115',1,'nav_menu_item','',0),(118,1,'2020-05-02 14:42:02','2020-05-02 14:42:02','','Coaching Offers','','publish','closed','closed','','coaching-offers','','','2020-05-03 10:37:46','2020-05-03 10:37:46','',0,'http://nicholasbarkercoaching.local/?p=118',2,'nav_menu_item','',0),(119,1,'2020-05-03 07:43:08','2020-05-03 07:43:08','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:7:\"courses\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:9:{i:0;s:11:\"the_content\";i:1;s:7:\"excerpt\";i:2;s:10:\"discussion\";i:3;s:8:\